import React from 'react';
import { Text, StyleSheet } from 'react-native';

const CreateRecord = () => {
    return (
        <Text>Hello create record</Text>
    );
}

const styles = StyleSheet.create({
    text: {
      color: '#ffff',
      fontSize: 50,
      textAlign: 'center',
      marginTop: 100
    }
});

export default CreateRecord;
